const G$1 = 9.81;
const FRAME_RATE = 30;
const _scale = new Vector3(1, 1, 1);

async function createPhysics() {
	await Ag();

	const gravity = new Vector3(0.0, - 9.81, 0.0);
	const world = new OI(gravity);

	const meshes = [];
	const meshMap = new WeakMap();

	const _vector = new Vector3();
	const _quaternion = new Quaternion();
	const _matrix = new Matrix4();

	function addMesh(mesh, mass = 0) {
		const { geometry: { parameters } } = mesh;
		const sx = parameters.width !== undefined ? parameters.width / 2 : 0.5;
		const sy = parameters.height !== undefined ? parameters.height / 2 : 0.5;
		const sz = parameters.depth !== undefined ? parameters.depth / 2 : 0.5;

		const shape = xI.cuboid(sx, sy, sz);
		shape.setMass(mass);

		const body = mesh.isInstancedMesh
			? createInstancedBody(mesh, mass, shape)
			: createBody(mesh.position, mesh.quaternion, mass, shape);

		if (mass > 0) {
			meshes.push(mesh);
			meshMap.set(mesh, body);
		}

	}

	function createInstancedBody(mesh, mass, shape) {
		const array = mesh.instanceMatrix.array;
		const bodies = [];

		for (let i = 0; i < mesh.count; i++) {
			const position = _vector.fromArray(array, i * 16 + 12);
			bodies.push(createBody(position, null, mass, shape));
		}

		return bodies;
	}

	function createBody(position, quaternion, mass, shape) {
		const desc = mass > 0 ? LA.dynamic() : LA.fixed();
		desc.setTranslation(...position);
		if (quaternion !== null) desc.setRotation(quaternion);

		const body = world.createRigidBody(desc);
		world.createCollider(shape, body);

		return body;
	}

	const clock = new Clock();

	function step() {
		world.timestep = clock.getDelta();
		world.step();

		for (let i = 0, l = meshes.length; i < l; i++) {
			const mesh = meshes[i];

			if (mesh.isInstancedMesh) {
				const array = mesh.instanceMatrix.array;
				const bodies = meshMap.get(mesh);

				for (let j = 0; j < bodies.length; j++) {
					const body = bodies[j];
					const position = body.translation();
					_quaternion.copy(body.rotation());
					_matrix.compose(position, _quaternion, _scale).toArray(array, j * 16);
				}

				mesh.instanceMatrix.needsUpdate = true;
				mesh.computeBoundingSphere();

			} else {
				const body = meshMap.get(mesh);
				mesh.position.copy(body.translation());
				mesh.quaternion.copy(body.rotation());
			}
		}
	}

	setInterval(step, 1000 / FRAME_RATE);

	document.getElementById('g-change-left').addEventListener('click', () => {
    gravity.x = -(G$1 - 2);
    gravity.y = 2;
  });

  document.getElementById('g-change-right').addEventListener('click', () => {
    gravity.x = (G$1 - 2);
    gravity.y = 2;
  });

  document.getElementById('g-change-top').addEventListener('click', () => {
    gravity.x = 0;
    gravity.y = G$1;
  });

	document.addEventListener('scroll', () => {
		console.log('scroll');
    gravity.x = 0;
    gravity.y = G$1;
  });

	return { addMesh };
}

// converts degress to radians
const rad = x => (x * Math.PI) / 180;

const map = (n, start1, stop1, start2, stop2) => (n - start1) / (stop1 - start1) * (stop2 - start2) + start2;

const choose = list => list[Math.floor(Math.random() * list.length)];

const WALL_THICKNESS = 0.01;
const WALL_HEIGHT = 20;
const WALL_DEPTH = 2;

const material = new MeshBasicMaterial({ transparent: true, opacity: 0 });

const makeMesh = (x = 10, y = 10) => {
  const geometry = new BoxGeometry(x, y, WALL_THICKNESS);
  const mesh = new Mesh(geometry, material);
  mesh.castShadow = false;
  mesh.receiveShadow = false;

  return mesh;
};

const getWidth = () => {
  if (window.innerWidth <= 1200) {
    return map(window.innerWidth, 320, 1200, 2.2, 7);
  }

  if (window.innerWidth <= 1440) {
    return map(window.innerWidth, 1200, 1440, 7, 7.5);
  }

  return map(window.innerWidth, 1440, 2560, 7.5, 8);
};

var walls = () => {
  const width = getWidth();
  // bit of overhang to avoid things falling thru the cracks
  const bottom = makeMesh(width + 1, WALL_DEPTH + 1);
  bottom.position.z = 0;
  bottom.rotation.x = rad(90);

  const left = makeMesh(WALL_DEPTH, WALL_HEIGHT);
  left.position.x = -(width/2);
  left.position.y = 10;
  left.position.z = 0;
  left.rotation.y = rad(90);
  left.rotation.x = rad(0);

  const right = makeMesh(WALL_DEPTH, WALL_HEIGHT);
  right.position.x = width/2;
  right.position.y = 10;
  right.position.z = 0;
  right.rotation.y = rad(-90);
  right.rotation.x = rad(0);

  const back = makeMesh(width, WALL_HEIGHT);
  back.position.y = 10;
  back.position.z = -1;
  back.rotation.x = rad(0);

  const front = makeMesh(width, WALL_HEIGHT);
  front.position.y = 10;
  front.position.z = 1;
  front.rotation.x = rad(0);

  return [
    bottom,
    left,
    right,
    back,
    front,
  ];
};

const addDirectionalLight = (scene) => {
  const dirLight = new DirectionalLight(0xffffff, 50);
  dirLight.position.set(-3, 8, 3);
  dirLight.castShadow = true;
  dirLight.shadow.camera.zoom = 2;
  dirLight.shadow.radius = 3;
  scene.add(dirLight.target);
  scene.add(dirLight);
  dirLight.target.position.set(0,0,0);
};


const addRectAreaLight = (scene) => {
  const width = 2.2;
  const height = 2.2;
  const intensity = 500;
  const rectLight = new RectAreaLight( 0xffffff, intensity,  width, height );
  rectLight.position.set( 0, 5, 5 );
  rectLight.lookAt( 0, 1, 0 );
  scene.add(rectLight);
};

var lights = {
  addScene: (scene) => {
    addDirectionalLight(scene);
    addRectAreaLight(scene);
  },
};

var galvanizedZinc = ({ hdri }) => {
  const textureLoader = new TextureLoader();
  const map = textureLoader.load('./img/zinc/diffuse.jpg');
  const roughnessMap = textureLoader.load('./img/zinc/roughness.jpg');
  const normalMap = textureLoader.load('./img/zinc/normal.jpg');

  [
    map,
    roughnessMap,
    normalMap,
  ].forEach((texture) => {
    texture.colorSpace = SRGBColorSpace;
    texture.wrapS = RepeatWrapping;
    texture.wrapT = RepeatWrapping;
  });

  return new MeshStandardMaterial({
    map,
    color: 0x555555,
    roughness: 0.75,
    metalness: 0.1,
    roughnessMap,
    normalMap,
    envMap: hdri,
  });
};

const PORTRAIT = 0;
const LANDSCAPE = 1;
const aspect = window.innerWidth >= window.innerHeight ? LANDSCAPE : PORTRAIT;

var createBars = ({ hdri }) => {
  const material = galvanizedZinc({ hdri });
  const matrix = new Matrix4();
  const boxScale = aspect === PORTRAIT ? 2.5 : 3.3;
  const boxCount = aspect === PORTRAIT ? 60 : 80;
  const geometryBox = new BoxGeometry(boxScale * 0.2, boxScale * 0.5, boxScale * 0.09);
  const bars = new InstancedMesh(geometryBox, material, boxCount);
  bars.instanceMatrix.setUsage(DynamicDrawUsage);
  bars.castShadow = true;
  bars.receiveShadow = true;

  for (let i = 0; i < bars.count; i++) {
    const boxX = aspect === PORTRAIT
      ? Math.random() * 1 - 0.5
      : Math.random() * 3 - 1.5;
    matrix.setPosition(boxX, Math.random() * 22 + 2, 0);
    bars.setMatrixAt(i, matrix);
  }

  return bars;
};

var createCamera = () => {
  const camera = new PerspectiveCamera(50, window.innerWidth / (window.innerHeight), 0.1, 100);
  const x = 0;
  const y = 2.5;
  camera.position.set(x,y,5);
  camera.lookAt(x,y,0);

  return camera;
};

var createRenderer = () => {
  const renderer = new WebGLRenderer({ antialias: true, alpha: true, canvas: document.getElementById('bars') });
  renderer.setPixelRatio(window.devicePixelRatio);
  renderer.setSize(window.innerWidth, window.innerHeight);
  renderer.shadowMap.enabled = true;
  renderer.shadowMap.type = PCFSoftShadowMap;

  return renderer;
};

